function day1part1(input, date) {
  let answer = 0
  for (let i = 0; i < input.length; i++) {
    for (let j = 0; j < input.length; j++) {
      let num1 = input[i]
      let num2 = input[j]
      if (num1 + num2 == date) {
        return num1 * num2
      }
    }
  }
}

function day1part2(input, date) {
  for (let i = 0; i < input.length; i++) {
    for (let j = 0; j < input.length; j++) {
      for (let k = 0; k < input.length; k++) {
        let num1 = input[i]
        let num2 = input[j]
        let num3 = input[k]
        if (num1 + num2 + num3 == date) {
          return num1 * num2 * num3
        }
      }
    }
  }
}

